import c from "../lib/IconBase.es.js";
import t from "../defs/Hurricane.es.js";
const e = r.forwardRef((o, a) => /* @__PURE__ */ r.createElement(c, { ref: a, ...o, weights: t }));
e.displayName = "HurricaneIcon";
const m = e;
export {
  m as Hurricane,
  e as HurricaneIcon
};
